;; **
;;; ### with a function
;; **

;; @@
(defn update-channel! [ mat fnc chan]
  (let [ channels (new-arraylist)]
    (split mat channels)
    (let [
      old-ch (nth channels chan)
      new-ch
    (u/bytes-to-mat!
      (new-mat (.height mat) (.width mat) (.type old-ch) )
       (byte-array (map fnc (u/mat-to-bytes old-ch) )))]
     (.set channels chan new-ch)
     (merge channels mat)
     mat)))
